import React from 'react';
import KPIChart from './KPIChart';

const Dashboard: React.FC = () => {
  const mockData1 = [65, 59, 80, 81, 56, 55, 40];
  const mockData2 = [45, 78, 60, 90, 85, 72, 55];
  const labels = ['January', 'February', 'March', 'April', 'May', 'June', 'July'];

  return (
    <div className="container mx-auto p-8">
      <h1 className="text-3xl font-bold mb-8 text-center">KPI Dashboard</h1>
      <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
        <KPIChart title="Sales Performance" data={mockData1} labels={labels} />
        <KPIChart title="Customer Growth" data={mockData2} labels={labels} />
      </div>
    </div>
  );
};

export default Dashboard;
